import Button from '../UI/Button'
import Prev from '../img/Prev.svg'
import Next from '../img/Next.svg'
import styles from './Header.module.css'
import { useSelector } from 'react-redux'
import { selectData } from '../State/dataSlice'

function Header({ setVisibleModal, start, end, setStart, setEnd }) {
  const data = useSelector(selectData)
  const nextPage = () => {
    if (data.length > 3) {
      setStart(start + 3)
    } else setStart(start + 3)
    if (end + 12 > data.length) {
      return setEnd(data.length)
    } else setEnd(end + 12)
  }
  return (
    <header className={styles.header}>
      <div className={styles.header_info}>
        <div onClick={() => setVisibleModal(true)}>
          <Button text={'Новый запрос'} width={128} height={38} />
        </div>
        <div className={styles.header_info__listCount}>
          <h2>1 из 1</h2>
        </div>
        <div className={styles.header_info__prevNext}>
          <img src={Prev} alt="prev" width={`8.27px`} height={`13.53px`} />
          <img src={Next} alt="next" onClick={nextPage} />
        </div>
      </div>
    </header>
  )
}

export default Header
